webpackJsonp([0xb8bc0d354af7],{5211:function(e,t){e.exports={data:{post:{html:"<p><b>Late</b><br />\nIf Iowa looks like <a href=\"http://iowa.weblogger.com/discuss/msgReader$954\">this</a>, I dread even to imagine what Minnesota looks like...</p>\n<p><b>Early</b><br />\nFrankfurter Allgemeine: <a href=\"http://c.moreover.com/click/here.pl?p15656731\">Court Allows Airbus to Expand Hamburg Facility</a> This clears the way for final assembly of the 'Super Airbus' A380 in Hamburg and the creation of 4000 jobs. Aviation (mainly Airbus and Lufthansa) is already the biggest industry in Hamburg (in terms of numbers of jobs), and Hamburg (behind Seattle and Toulouse) is the 3rd largest aviation city in the world. However, the new assembly hall is set to be built on a mudflat that is a EU-protected wildlife refuge.</p>\n<p>A couple of weeks ago I said we were 99% sure. Now we are 100% sure, and we know when it will happen. But we can't say what it is yet. This is the Internet, after all, and we don't know who all will be reading this. But next Wednesday, the 28th, we'll have a big announcement to make. And you heard it here first.</p>",fields:{title:"More of the Same",date:"22 Feb 2001",url:"https://papascott.de/2001-02-22-more-of-the-same/"}}},pathContext:{slug:"/2001-02-22-more-of-the-same/",prev:{fields:{title:"With or Without You",date:"20 Feb 2001",slug:"/2001-02-20-with-or-without-you/"}},next:{fields:{title:"Long for your Kiss",date:"24 Feb 2001",slug:"/2001-02-24-long-for-your-kiss/"}}}}}});
